ows you to carry out purchase transactions either in Cash or Credit. Purchase Management covers - recording vendor\'s invoice, making payment and creating debit note among others.','purchasemanagement2'),('191','Dashboard','Sales and Billing Management','1','Sales and Billing Management','Allows you to carry out Sales and Billing transactions either in Cash or Credit. Sales and Billing Management covers - recording customer\'s invoice and receiving payment among others.','salesAndBillingManagement2'),('192','Dashboard','Customer & Vendor Management','1','Customer & Vendor Management','Allows you to maintain comprehensive information about your customers and vendors. Capture Customer and Vendor information related to transaction currency, payment terms, opening balance, contact information and more.','customerVendorManagement2'),('193','Dashboard','Payment Management','1','Payment Management','Manage all your customer and vendor payment records with multiple payment methods including cash, cheque and debit/credit card.','paymentManagement2'),('194','Dashboard','Account Management','1','Account Management','Allows you to manage comprehensive information about various accounts through \"Chart of Accounts\", and record journal entry for transactions that are not carried out either through Purchase or Sales process.','accountManagement2'),('195','Dashboard','Ratio Analysis Report','1','Ratio Analysis Report','Quantitative Analysis of information in a company\'s financial statements.','ratioAnalysis'),('196','Dashboard','Financial Reports','1','Financial Reports','Monitor all transactions through financial reports such as Profit and Loss, Balance Sheet, Trial Balance, Aged Receivables, Aged Payables, Invoice and Cash Sales Report and more.','financialReports1'),('197','Dashboard','Financial Reports','1','Financial Reports','Monitor all transactions through financial reports such as Profit and Loss, Balance Sheet, Trial Balance, Aged Receivables, Invoice and Cash Sales Rep